                class="flex-1-1-100 rounded-12 pa-4"
                variant="tonal"
                block
                size="large"
            >
                <div class="d-flex align-start w-full text-t-xl font-weight-semibold">
                    <span>
                        레슨 {{ info.order }}
                    </span>

                    <v-spacer />

                    <!-- status -->
                    <v-chip
                        v-if="info.step > 3"
                        variant="outlined"
                        class="xxs secondary"
                    >
                        완료
                    </v-chip>

                    <v-chip
                        v-else-if="info.step > 0"
                        variant="outlined"
                        class="xxs info"
                    >
                        진행중
                    </v-chip>

                    <v-img
                        v-else-if="info.step == 0"
                        src="/icons/IconLock.svg"
                        width="24"
                        height="24"
                        class="flex-grow-0"
                    />
